void maketable(double tab1[][26], double tab2[][26], double result[][26], double a)
{
	double b = 1 - a;

	for (int i = 0; i < 16; i++)
	{
		for (int k = 0; k < 26; k++)
		{
			if (k == 0 or k == 1) result[i][k] = tab1[i][k];
			else
			result[i][k] = (b*tab1[i][k] + a*tab2[i][k])/(a+b);
		}
	}
};

void make_app(double Ek, int k, double *res, double pdataHE[][29])
{
	for (int i = 0; i < 25; i++) res[i] = pdataHE[k][i];

	double E2 = (pdataHE[k][1] + pdataHE[k][0])/2.0;
	double E1 = (pdataHE[k-1][1] + pdataHE[k-1][0])/2.0;
		
	double a = E2 - Ek;
	double b = Ek - E1;
		
	for (int i = 25; i < 29; i++) res[i] = (a*pdataHE[k][i] + b*pdataHE[k-1][i])/(a+b);
};

